criteria.textblock:
        Inclusion Criteria:

          -  adult patients, 18-75 years of age;

          -  type 2 diabetes, diagnosed for >=3 months;

          -  either treated with diet, exercise and stable metformin, or with diet and exercise
             alone.

        Exclusion Criteria:

          -  type 1 diabetes mellitus;

          -  currently or within 2 months prior to screening treated with an oral or injectable
             anti-diabetic agent except stable doses of metformin;

          -  currently or within 6 months prior to screening treated with any PPARgamma agonist;

          -  uncontrolled hypertension;

          -  significant pre-diagnosed diabetic complications requiring treatment.
